import React from 'react';

const AdminDashboard  = React.lazy(() => import('./components/Views/Admin'));
const Categories  = React.lazy(() => import('./components/Views/Admin/Categories'));
const Courses  = React.lazy(() => import('./components/Views/Admin/Courses'));

const DeviceDashboard  = React.lazy(() => import('./components/Views/Devicemanagement/DeviceDashboard'));
const DeviceCommandHistory  = React.lazy(() => import('./components/Views/Devicemanagement/DeviceCommandHistory'));
const Devices  = React.lazy(() => import('./components/Views/Devicemanagement/Devices'));

const AnalysticsDashboard  = React.lazy(() => import('./components/Views/Analystics/dashboard/Dashboard'));

// https://github.com/ReactTraining/react-router/tree/master/packages/react-router-config
const routes = [
  { path: '/modules/admin', exact: true, name: 'Admin', component: AdminDashboard},
  { path: '/modules/admin/dashboard', name: 'Dashboard', component: AdminDashboard },
  { path: '/modules/admin/categories', name: 'Categories', component: Categories }, 
  { path: '/modules/admin/courses', name: 'Courses', component: Courses },

  { path: '/modules/devicemanagement',exact: true, name: 'Device Management', component: DeviceDashboard },
  { path: '/modules/devicemanagement/dashboard', name: 'Dashboard', component: DeviceDashboard },
  { path: '/modules/devicemanagement/dashboard/:id',  name: 'Command History', component: DeviceCommandHistory },
  { path: '/modules/devicemanagement/device', name: 'Devices', component: Devices },

  { path: '/modules/analystics', exact: true, name: 'Analystics', component: AnalysticsDashboard },
  { path: '/modules/analystics/dashboard', name: 'Dashboard', component: AnalysticsDashboard },  

];

export default routes;
